Insert into ATHEGO.RATINGS (NO,SCORE,CONTENT,REGDATE,USER_NO,NOLGO_NO) values (3,3,'TV에서 여행프로그램을 볼때마다 타이완이란 나라는 매력적으로 다가왔다.홍등이 예쁜 지우펀에서 행방불명 된 센과 치히로도 찾고 꽃할배들이간 타이루거 협곡도 가보고자 시작된 3박4일 대만 패키지 여행~~',to_timestamp('18/06/20 00:00:00.000000000','RR/MM/DD HH24:MI:SSXFF'),1,1);
